import unittest
import os
from quiz1 import helloString
from quiz2 import read_csv
from quiz3 import lottery

class TestQuiz(unittest.TestCase):
    """ Test Case for Quiz 1"""
    def test_quiz_string(self):
        functionTest = helloString("Sennalabs")
        self.assertEqual(functionTest, "Hello, Sennalabs!")

    def test_quiz_string2(self):
        functionTest = helloString("Santa Claus")
        self.assertEqual(functionTest, "Hello, Santa Claus!")

    # Test Case for Quiz 2
    def test_quiz_csv(self):
        file = 'quiz2.csv'
        my_dir = os.path.dirname(__file__)
        file_path = os.path.join(my_dir, file)
        self.assertEqual(read_csv(file_path), "Frodo Baggins\nBill Gates\nSteve Jobs\nMichael Jordan\nBarack Obama\nChristian Ronaldo\nMichael Schumacher\nTiger Woods\n")

